import React, { Component } from 'react';
import { Grid, Dropdown } from 'semantic-ui-react'
import './WODGenerator.css'

class WODGenerator extends Component {
    state = { 
        type: null, 
        category: null
     }


    handleChange = (e, {value}) => {
        this.setState({type: value})
    }
    render() {

        const workOptions = [
            {
              key: 'Strength',
              text: 'Strength',
              value: 'strength'
            },
            {
              key: 'Hypertrophy',
              text: 'Hypertrophy',
              value: 'hypertrophy',
            },
            {
              key: 'Metabolic Conditioning',
              text: 'Metabolic Conditioning',
              value: 'metabolic-conditioning'
            },
            {
              key: 'Full Body',
              text: 'Full Body',
              value: 'full-body'
            },
        ]

        const categoryOptions = [
            {
              key: 'Olympic Lifting',
              text: 'olympic-lifting',
              value: 'olympic-lifting'
            },
            {
              key: 'Powerlifting',
              text: 'powerlifting',
              value: 'powerlifting',
            },
            {
              key: 'Gymn',
              text: 'Gymn',
              value: 'metabolic-conditioning'
            },
            {
              key: 'Full Body',
              text: 'Full Body',
              value: 'full-body'
            },
        ]

        return (
            <> <br/><br/><br/>
            <h1 className='h2'>WOD Generator</h1><br/><br/>
            <Grid columns={2} divided>
                <Grid.Row>
                <Grid.Column>
                    <span className='animated zoomIn dropdown-txt'>
                        I want to work on {' '}
                        <Dropdown
                        inline
                        options={workOptions}
                        defaultValue={""}
                        onChange={this.handleChange}
                        />
                    </span> <br/><br/><br/>
                    {this.state.type === "strength"&&
                    <span className='animated zoomIn dropdown-txt'>
                        Category of {' '}
                        <Dropdown
                        inline
                        options={categoryOptions}
                        defaultValue={""}
                        onChange={this.handleChange}
                        />
                    </span>
                    }
                </Grid.Column>
                <Grid.Column>
                2
                </Grid.Column>
                </Grid.Row>
            </Grid>
            </>
        );
    }
}

export default WODGenerator;
